import { Container } from "react-bootstrap";

const Summary = () => (
  <section id="summary" className="py-5 bg-white">
    <Container>
      <h2 className="mb-4">Professional Summary</h2>
      <p>
        Insurance and Risk Management Specialist with <strong>10+ years of experience</strong> across underwriting,
        claims, and coordination for major insurers like Muang Thai, Tokio Marine, and Kerry Siam Seaport. 
        Proven track record in <strong>leading claim teams</strong>, optimizing workflows, and integrating tech like React, Flask, and BigQuery into insurance operations.
      </p>
      <p>
        Currently building Cheetah Insurance Broker â€” a car insurance comparison platform integrating <strong>React</strong>, <strong>Flask</strong>, <strong>BigQuery</strong>, and <strong>2C2P</strong> payment gateway.  
        Skilled in <strong>data analysis, risk consulting, insurance tech</strong>, and cross-functional coordination.
      </p>
    </Container>
  </section>
);

export default Summary;
